import logo from './logo.svg';
import Message from './components/Message';


function App() {

  let content = "Feugiat sapien volutpat eget etiam. Elit nam ut at rutrum enim arcu turpis non phasellus"
  let sentAt = new Date(2025, 4, 18, 7, 30);
  let isEdited = false;
  let images = [];
  let user = {
    avatar: "https://letsenhance.io/static/73136da51c245e80edc6ccfe44888a99/1015f/MainBefore.jpg",
    firstName: "allo",
    lastName: "alloallo",
  }
  let isLeft = true;

  return (
    <>
      <Message
        content={content}
        sentAt={sentAt}
        isEdited={isEdited}
        images={images}
        user={user}
        isLeft={isLeft}
      ></Message>
    </>
  );
}

export default App;
